import React from "react";
import "./Nav.css";
function Nav() {
  return (
    <form className="form">
      <div>
        <h1>List of URLs</h1>
      </div>
      <div>
        <input type="submit" value="save" className="button1" />
      </div>
    </form>
  );
}

export default Nav;
